  //var trie = require('../doc/considerPhlebas.txt.trie.js');
  //var counts = require('../doc/considerPhlebas.txt.table.js');

  describe.only('willing to compare speed of search', function() {
    before(function() {
      this.timeout(60000000);
      this.numRuns = 100000;
      this.countsNum = 10910;
      this.trie = require('../doc/considerPhlebas.txt.trie.js');
      this.counts = require('../doc/considerPhlebas.txt.table.js');
      this.keys = Object.keys(this.counts);
    }); 
    it('one can search a lot of times in the big trie, measuring how long it takes', function() {
      var randomTrieValue;
      var startMillis = new Date().getTime();
      H.log('Start ' + this.numRuns + ' searches in the big trie: ' + new Date().toString());
      for (var counter = 1; counter < this.numRuns; counter++) {
        var randomKeyPos = Math.floor(Math.random() * this.countsNum) - 1;
        var randomKey = this.keys[randomKeyPos];
        try {
          randomTrieValue = TRIE.get(randomKey, this.trie);
        } catch (e) {}
        H.log(++counter + ': ' + randomKey + ' -> ' +  randomTrieValue + '                                                  \033[F'); 
      }
      var endMillis = new Date().getTime();
      var elapsed;
      try { elapsed = (endMillis - startMillis)/1000 } catch (e) {}
      H.log('Search in trie completes: ' + new Date().toString());
      H.log('Processing time in secs: ' + elapsed);
    });
    it('one can search once in the big counts table', function() {
      var randomTableValue;
      var startMillis = new Date().getTime();
      H.log('Start ' + this.numRuns + ' searches in the big counts table: ' + new Date().toString());
      for (var counter = 1; counter < this.numRuns; counter++) {
        var randomKeyPos = Math.floor(Math.random() * this.countsNum) - 1;
        var randomKey = this.keys[randomKeyPos];
        try {
          randomTableValue = counts[randomKey];
        } catch (e) {}
        H.log(++counter + ': ' + randomKey + ' -> ' +  randomTableValue + '                                                  \033[F'); 
      }
      var endMillis = new Date().getTime();
      var elapsed;
      try { elapsed = (endMillis - startMillis)/1000 } catch (e) {}
      H.log('Search in counts table completes: ' + new Date().toString());
      H.log('Processing time in secs: ' + elapsed);
    });
  });
